import Link from 'next/link';

const Index = () =>(
    
    <div>
    <ul>
        <li><Link href='/'><a>Inicion</a></Link></li>
        <li><Link href='/nostros'><a>Nosotros</a></Link></li>

    </ul>
    <p> Hola mundo</p>

    </div>
)

export default Index;
